from datetime import datetime
import time
import json


host = 'http://localhost:9292'

with open('urls.txt', 'a') as the_file:
    for a in args:
        try:
            # fix the datecreated and convert it to utc
            d = a[4].replace(' GMT-0500 (EST)', '').replace(' GMT-0400 (EDT)', '')
            date_created = datetime.strptime(d, '%a %b %d %Y %H:%M:%S')
            date_created = time.mktime(date_created.timetuple())
            date_created = time.mktime(time.gmtime(date_created))

            d = json.dumps({
                "title": a[0].replace("'", "\'\'").replace('"', '\\"'),
                "description": a[1].replace("'", "\'\'").replace('"', '\\"'),
                "uri": a[2],
                "tags": a[3],
                "date_created": date_created,
                "username": a[5],
                "slack_id": a[6],
            })
            entry = """curl -H "Content-Type: application/json" -X POST --data '{data}' {host}/api/slack/resource;\n""".format(data=d, host=host)
            the_file.write(entry)
        except Exception as e:
            print("RECORD NOT VALID ", a)
            print(e)
